import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import GetWish from "./API/GetWish";

function ChangePage(props)
{
    const params = useParams();
    const id = params.id;
    const [userId, setId] = React.useState(0);
    const [present, setPresent] = React.useState(props.present)
    const[price, setPrice] = React.useState(props.price)
    const [wishs, setWishs] = React.useState([{id:0, present:"", price:"", reservUser:0, reservUserName:"", userId:0, userName:""}])
    useEffect(()=>{
        const get = async () =>{
          const data = await GetWishs(props.id);
          setWishs(data);
        }
        get();
      }, []);

      if(wishs.length<1)
      {
        return(<h1 className="H">Пока что у вас нет желаний</h1>);   
      }

      if(wishs[0].id==0)
        return(<></>);  


    return(
        <div>
            <form>
                <h3>Изменить желание</h3>
                <p>
                    <label>Подарок </label>
                    <input type="text" value={present} onChange={(e) => setPresent(e.target.value)}></input>
                </p>
                <p>
                    <label>Цена </label>
                    <input type="number" value={price} onChange={(e) => setPrice(e.target.value)}></input>
                </p>
            </form>
        </div>
    )
}
export default ChangePage
